private List<String> collectValues(Table table) {
    List<String> values = new ArrayList<>();
    for (TableItem item : table.getItems()) {
        String value = item.getText().trim();
        if (value.isEmpty() || value.equals("%")) { 
            continue;
        }
        values.add(value);
    }
    return values;
}

